import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {createStore} from 'redux'
import {Provider} from 'react-redux'
import rootReducer from './Service/Reducer/index'
const store=createStore(rootReducer);
ReactDOM.render(
  <Provider store={store}>
  <App />
  </Provider>

